import React from 'react';
import './App.css';
import { Button, Box } from "@material-ui/core";

function App() {
  return (
    <div className="App">
      <Button> hello world! </Button>
      <Box component="span" m={1}>
        <Button/>
      </Box>
    </div>
  );
}

export default App;
